import "./App.css";
import { ClienteServiceClient } from "./pb/subastas_grpc_web_pb"


function App(){

  var client = ClienteServiceClient("http://localhost:8000", null, null)

  const takeCliente = () => {
    console.log(client);
    client.getCliente({id:"1"}, (e, r) => console.log(e, r))
    console.log("hoola rick")
  }

  return(
    <div className="App">
      <h1> Hello, World! </h1>
      <button href="#" onClick={takeCliente}>Clickeame</button>
    </div>
  );
}

export default App;
